"""
题目：1007. 行相等的最少多米诺旋转
在一排多米诺骨牌中，A[i] 和 B[i] 分别代表第 i 个多米诺骨牌的上半部分和下半部分。（一个多米诺是两个从 1 到 6 的数字同列平铺形成的 —— 该平铺的每一半上都有一个数字。）

我们可以旋转第 i 张多米诺，使得 A[i] 和 B[i] 的值交换。

返回能使 A 中所有值或者 B 中所有值都相同的最小旋转次数。

如果无法做到，返回 -1.

示例 1：
输入：A = [2,1,2,4,2,2], B = [5,2,6,2,3,2]
输出：2
解释：
如果我们旋转第二个和第四个多米诺骨牌，我们可以使上面一行中的每个值都等于 2。

示例 2：
输入：A = [3,5,1,2,3], B = [3,6,3,3,4]
输出：-1
解释：
在这种情况下，不可能旋转多米诺牌使一行的值相等。
 
提示：

1 <= A[i], B[i] <= 6
2 <= A.length == B.length <= 20000

@author Niefy
@date 2019-03-12
"""
import sys
class Solution:
    def minDominoRotations(self, A, B) -> int:
        length=len(A)
        def countRotations(A, B,eq):#以eq(只能取A[0]或B[0])为基准计算旋转次数(最终让A全部为一个值)
            count=0
            for i in range(0,length):
                if A[i]!=eq and B[i]==eq:#需要交换
                    count+=1
                elif A[i]!=eq and B[i]!=eq:#不满足
                    count=sys.maxsize
                    break
            if count<=length and count>length/2:
                count=length-count
            print('count=',count)
            return count
        res=min(countRotations(A,B,A[0]),countRotations(A,B,B[0]),countRotations(B,A,B[0]),countRotations(B,A,A[0]))
        if res==sys.maxsize:
            return -1
        return res
        

#测试代码
t=Solution()
A = [2,1,2,4,2,2]
B = [5,2,6,2,3,2]
print(t.minDominoRotations(A,B))

A = [3,5,1,2,3]
B = [3,6,3,3,4]
print(t.minDominoRotations(A,B))

A = [3,2,2,2,2]
B = [2,2,2,2,2]
print(t.minDominoRotations(A,B))

A = [3,2,2,2,2]
B = [2,3,4,5,6]
print(t.minDominoRotations(A,B))

